import { Car } from 'src/app/models/car.model';

@Component({
  selector: 'app-add-car',
  templateUrl: './add-car.component.html',
  styleUrls: ['./add-car.component.css']
})
export class AddCarComponent {

  addCarClass: Car = {

    name: '',
    model: '',
    horsepower: '',
    color: '',
    cost: ''

  }

  constructor() { }

  addCar() {
    console.log(this.addCarClass);
  }
}
